       x="281.93201"
       y="835.93231"
       id="text3249"><tspan
         sodipodi:role="line"
         id="tspan3247"
         x="281.93201"
         y="835.93231"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335">Next is Python: Probably one of the greatest</tspan><tspan
         sodipodi:role="line"
         x="281.93201"
         y="853.57123"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335"
         id="tspan3251">languages ever, if of course the rest of them never existed!</tspan><tspan
         sodipodi:role="line"
         x="281.93201"
         y="871.21008"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335"
         id="tspan3253">And after that, we have C++: This one is not yet a</tspan><tspan
         sodipodi:role="line"
         x="281.93201"
         y="888.849"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335"
         id="tspan3255">dinosaur, but its certainly on its way!</tspan><tspan
         sodipodi:role="line"
         x="281.93201"
         y="906.48785"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335"
         id="tspan3257">And finally, the one we've all been waiting for, Lisp!</tspan><tspan
         sodipodi:role="line"
         x="281.93201"
         y="924.12677"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335"
         id="tspan3275">Lisp is beautiful, syntactically perfect,</tspan><tspan
         sodipodi:role="line"
         x="281.93201"
         y="941.76569"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335"
         id="tspan3263">and otherwise the best language we have on the table today!</tspan><tspan
         sodipodi:role="line"
         x="281.93201"
         y="959.40454"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335"
         id="tspan3259">Observe its flowing syntax, its seas of parenthesis flowing on shores of</tspan><tspan
         sodipodi:role="line"
         x="281.93201"
         y="977.04346"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335"
         id="tspan3261">cleanliness with tides of Function Oriented Programming...</tspan><tspan
         sodipodi:role="line"
         x="281.93201"
         y="994.68231"
         style="font-size:17.63889122px;line-height:1;stroke-width:0.26458335"
         id="tspan3269">There can truly be no contenders to compete with Lisp!</tspan></text>

            <script type="text/javascript">

Parse.serverURL = "https://parseapi.back4app.com/";
const Comment = Parse.Object.extend('Comment');
var usernamefield=document.getElementById("username");
var bodyfield=document.getElementById("body");
function post(){
    _post(usernamefield.value,bodyfield.value,174);
}
function _post(user,body,cmnum){
    var myNewObject = new Comment();
    myNewObject.set('user', user);
    myNewObject.set('body', body);
    myNewObject.set('comic', cmnum);

    myNewObject.save().then(
        (result) => {
            document.getElementById("comments-arena").innerHTML="";
            load();
        },
        (error) => {
        if (typeof document !== 'undefined') document.write(`Error while creating Comment: ${JSON.stringify(error)}`);
        console.error('Error while creating Comment: ', error);
        }
    );
}
function load(){
    query = new Parse.Query(Comment);
    query.equalTo("comic", 174);
    query.find().then((results) => {
        arena=document.getElementById("comments-arena");
        results.reverse();
        results.forEach(function(element,index){
            p4=document.createElement("li");
            p=document.createElement("div");
            p4.appendChild(p);
            pp=document.createElement("p");
            ppp=document.createElement("p");
            arena.appendChild(p4);
            p4.className="comment-listitem";
            ppp.innerText=element.get("body");
            p.className="comment_box";
            pp.className="comment_user_text";
            pp.innerText=element.get("user");
            pp.className="username_p";
            p.appendChild(pp);
            p.appendChild(ppp);
        });
    }, (error) => {
        if (typeof document !== 'undefined') document.write(`Error while fetching Comment data. Please reload this page or submit a bug report to my email address (plupy44@gmail.com)}`);
    });
}
load();
